/* Custom variables
** These variables are only used in this theme
** ---------------------------------------------- */
/* Packages variables
** These variables are used to override packages
** ---------------------------------------------- */
/* Debug
** Output variables to the top of the UI
** ------------------------------------- */
.select-list .loading .loading-message::before {
  font-family: 'Octicons Regular';
  font-weight: normal;
  font-style: normal;
  display: inline-block;
  line-height: 1;
  -webkit-font-smoothing: antialiased;
  text-decoration: none;
  font-size: 16px;
  width: 16px;
  height: 16px;
  content: "\f09e";
}
.select-list .loading .loading-message::before {
  font-size: 1.1em;
  width: 1.1em;
  height: 1.1em;
  margin-right: 5px;
}
.select-list .loading .badge {
  margin-left: 10px;
}
.select-list ol.list-group {
  position: relative;
  overflow-y: auto;
  max-height: 312px;
  margin: 10px 0 0 0;
  padding: 0;
}
.select-list ol.list-group li {
  display: block;
}
.select-list ol.list-group li .primary-line,
.select-list ol.list-group li .secondary-line {
  text-overflow: ellipsis;
  white-space: nowrap;
  overflow: hidden;
}
